import React from 'react';
import ImagesCollection from './ImagesCollection';

const Cards = ({ person }) => {
	return(
		<div>
			<ImagesCollection person = {person.name}/>		
			<h2>{ person.name }</h2>
			<h4>{ person.height }</h4>
			<h4>{ person.eye_color }</h4>
			<h4>{ person.hair_color }</h4>
			<h4>{ person.skin_color }</h4>
			<h4>{ person.eye_color }</h4>
			<h4>{ person.birth_year }</h4>
			<h4>{ person.gender }</h4>
			<br/>
		</div>			
	)
}

export default Cards;
